package com.excel;

public class Mark {
	private String code;
	private String name;
	private String score;
	
	public Mark() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Mark(String code, String name, String score) {
		super();
		this.code = code;
		this.name = name;
		this.score = score;
	}

	public String getCode() {
		return code;
	}

	public void setCode(String code) {
		this.code = code;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public String getScore() {
		return score;
	}

	public void setScore(String score) {
		this.score = score;
	}
	
	
	
}
